-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `mid` char(32) NOT NULL COMMENT '用户长id',
  `username` varchar(64) NOT NULL COMMENT '用户名/手机。只能手机登陆.',
  `password` varchar(128) NOT NULL COMMENT '密码',
  `random` varchar(128) NOT NULL COMMENT '密码随机数, 加密后',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '商家类型:0-买家|1-设计师|2-设计机构|3-设计馆|7-工长|8-装修公司|9-装企子账号(二级管员)|10-装企内部工长|11-装企内部质检|12-个人监理|13监理机构|17材料商|18-套餐装企|19-套餐装企子账号|20-套餐装企内部工长|21-套餐装企内部监理|22-品牌总部|23-品牌总部子账号',
  `register_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '注册来源：0-PC端|1-管理员添加|2-微信注册|3-QQ注册|4-手机短信|5-体验区|6-微信小程序|7-Android|8-IOS|9-WAP',
  `phone_token` varchar(128) DEFAULT NULL COMMENT '手机登陆 TOKEN 移动端单个在线',
  `nickname` varchar(64) DEFAULT NULL COMMENT '个人用户昵称/企业用户简称',
  `pic` varchar(256) DEFAULT '' COMMENT '用户头像(业主/个人专业角色标识必须有默认值)',
  `tel` varchar(16) DEFAULT NULL COMMENT '绑定手机号码：同一个注册手机号,只能绑定一个手机',
  `provice` int(11) DEFAULT '0' COMMENT '省代码',
  `city` int(11) DEFAULT '0' COMMENT '城市代码',
  `change_city_status` tinyint(4) unsigned DEFAULT '0' COMMENT '城市变更状态：0-初始|1-申请变更|2-已取消|3-更换成功',
  `change_city` int(11) DEFAULT '0' COMMENT '切换地城市代码',
  `change_area` int(11) DEFAULT '0' COMMENT '切换地区域代码',
  `city_update_time` datetime DEFAULT NULL COMMENT '城市最后更新时间1',
  `phone` varchar(32) DEFAULT NULL COMMENT '联系电话',
  `qq` varchar(32) DEFAULT NULL COMMENT '用户QQ',
  `wx` varchar(64) DEFAULT NULL COMMENT '用户微信',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `email_status` tinyint(4) DEFAULT '0' COMMENT '邮箱验证:1-已验证|0-未验证',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '会员状态:1有效|0无效',
  `guide_status` tinyint(1) DEFAULT '0' COMMENT '推广能力,默认0,普通业主,1城运商发起申请,2通过审核,3审核不通过,4停止推广能力,专业角色只有1234,不允许出现0',
  `guider_time` datetime DEFAULT NULL COMMENT '申请成为推客的时间',
  `haveim` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否注册了im:0-未注册|1-已注册',
  `login_time` datetime DEFAULT NULL COMMENT '登陆时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `mid` (`mid`) COMMENT '用户长ID唯一',
  UNIQUE KEY `username` (`username`,`type`) USING BTREE,
  KEY `tel` (`tel`,`type`) USING BTREE,
  KEY `email` (`email`,`type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1132 DEFAULT CHARSET=utf8 COMMENT='平台用户主表';

